import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Navbar from './Components/navbar';
import DataHeader from './Components/dataHeader';
import reportWebVitals from './reportWebVitals';

class Data extends React.Component {
	render (){
		return (
			<div className="Data">
				<Navbar />
				<DataHeader />
				<div >
                    <h2 class="desc-s full-block" contenteditable="true">I'm an ordinary guy who wants to be a great developer. However, one day I met another guy named Fa_ and I realize that he has already achieved my dream <i class="fas fa-pencil-alt"></i></h2>
                </div>
				<div class="col block-right">
					<a class="btn btn-cta-primary-yellow round" href="#" target="_blank">ยืนยันตัวตน</a>
				</div>
			</div>
		);
	}
}

export default Data;
